import React from "react";
import { Text, View, Image } from "react-native";
import icon from "./assets/icon.png";

function App() {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Image resizeMode="cover" source={icon} />
      <Text>Abc</Text>
    </View>
  );
}

export default App;
